document.addEventListener("DOMContentLoaded", () => {
  // DOM elements
  const registrationForm = document.getElementById("registrationForm")
  const startBtn = document.getElementById("startBtn")
  const quizContainer = document.querySelector(".quiz-container")
  const timerContainer = document.getElementById("timerContainer")
  const timerElement = document.getElementById("timer")
  const frontendQuestions = document.getElementById("frontendQuestions")
  const computerQuestions = document.getElementById("computerQuestions")
  const nextBtns = document.querySelectorAll(".nextBtn")
  const finishBtns = document.querySelectorAll(".finishBtn")
  const lastResultElement = document.getElementById("lastResult")
  const lastResultContent = document.getElementById("lastResultContent")

  // Variables
  let currentTest = 0
  let score = 0
  let userName = ""
  let selectedCourse = ""
  let timer
  let timeLeft = 5 * 60 // 5 minutes in seconds
  let currentQuestionSet = null
  let answers = {}

  // Check for last result in localStorage
  const showLastResult = () => {
    const lastResult = localStorage.getItem("lastQuizResult")
    if (lastResult) {
      lastResultElement.style.display = "block"
      lastResultContent.innerHTML = lastResult
    }
  }

  showLastResult()



  // Start the quiz
  startBtn.addEventListener("click", () => {
    userName = document.getElementById("userName").value.trim()
    selectedCourse = document.getElementById("courseSelect").value

    if (!userName) {
      alert("Iltimos, ismingizni kiriting!")
      return
    }

    if (!selectedCourse) {
      alert("Iltimos, kursni tanlang!")
      return
    }

    // Hide registration form and show quiz
    registrationForm.style.display = "none"
    quizContainer.style.display = "block"
    timerContainer.style.display = "block"
    lastResultElement.style.display = "none"

    // Show questions based on selected course
    if (selectedCourse === "frontend") {
      frontendQuestions.style.display = "block"
      computerQuestions.style.display = "none"
      currentQuestionSet = frontendQuestions
    } else {
      frontendQuestions.style.display = "none"
      computerQuestions.style.display = "block"
      currentQuestionSet = computerQuestions
    }

    // Reset score and answers
    score = 0
    answers = {}
    currentTest = 0

    // Start timer
    startTimer()

    // Show first question
    showTest(currentTest)
  })

  // Timer function
  function startTimer() {
    timeLeft = 5 * 60 // Reset to 5 minutes
    updateTimerDisplay()

    timer = setInterval(() => {
      timeLeft--
      updateTimerDisplay()

      if (timeLeft <= 0) {
        clearInterval(timer)
        finishQuiz()
      }
    }, 1000)
  }

  function updateTimerDisplay() {
    const minutes = Math.floor(timeLeft / 60)
    const seconds = timeLeft % 60
    timerElement.textContent = `${minutes.toString().padStart(2, "0")}:${seconds.toString().padStart(2, "0")}`

    // Change color when time is running out
    if (timeLeft < 60) {
      timerElement.style.color = "red"
    } else {
      timerElement.style.color = "black"
    }
  }

  // Show test question
  function showTest(index) {
    const tests = currentQuestionSet.querySelectorAll(".test")
    tests.forEach((test, i) => {
      test.style.display = i === index ? "block" : "none"
    })
  }

  // Add event listeners to all answer buttons for immediate feedback
  document.querySelectorAll(".varianlar button").forEach((button) => {
    button.addEventListener("click", function () {
      // Check if answers were already selected for this question
      const testId = this.closest(".test").id
      if (answers[testId]) {
        return // If already answered, do nothing
      }

      // Remove any previous selection in this question
      const parentDiv = this.closest(".varianlar")
      parentDiv.querySelectorAll("button").forEach((btn) => {
        btn.classList.remove("selected")
        btn.classList.remove("correct")
        btn.classList.remove("incorrect")
      })

      // Mark this button as selected
      this.classList.add("selected")

      // Check if answer is correct and provide immediate feedback
      if (this.hasAttribute("data-correct")) {
        this.classList.add("correct")
        score++
      } else {
        this.classList.add("incorrect")

        // Highlight the correct answer
        parentDiv.querySelectorAll("button[data-correct]").forEach((btn) => {
          btn.classList.add("correct-answer")
        })
      }

      // Store the answer
      const selected = this.getAttribute("data-variant")
      const isCorrect = this.hasAttribute("data-correct")
      answers[testId] = { selected, isCorrect }

      // Disable all buttons in this question after selection
      parentDiv.querySelectorAll("button").forEach((btn) => {
        btn.disabled = true
        btn.classList.add("disabled")
      })
    })
  })

  // Next button event listeners
  nextBtns.forEach((btn) => {
    btn.addEventListener("click", () => {
      const testId = btn.closest(".test").id
      if (!answers[testId]) {
        alert("Iltimos, avval javobni tanlang!")
        return
      }
      currentTest++
      showTest(currentTest)
    })
  })

  // Finish button event listeners
  finishBtns.forEach((btn) => {
    btn.addEventListener("click", () => {
      const testId = btn.closest(".test").id
      if (!answers[testId]) {
        alert("Iltimos, oxirgi savolga javob bering!")
        return
      }
      finishQuiz()
    })
  })

  // Finish quiz and show results
  function finishQuiz() {
    clearInterval(timer)

    // Calculate total questions and correct answers
    const totalQuestions = Object.keys(answers).length
    const correctAnswers = Object.values(answers).filter((answer) => answer.isCorrect).length

    // Create appropriate message based on whether time expired
    let timeExpiredMessage = ""
    if (timeLeft <= 0) {
      timeExpiredMessage = '<p class="time-expired">Vaqt tugadi!</p>'
    }

    // Create result HTML
    const resultHTML = `
      <div class="result">
        <h2>Test yakunlandi!</h2>
        ${timeExpiredMessage}
        <div class="result-info">
          <p><strong>Ism:</strong> ${userName}</p>
          <p><strong>Kurs:</strong> ${selectedCourse === "frontend" ? "Frontend dasturlash" : "Kompyuter savodxonligi"}</p>
          <p><strong>To'g'ri javoblar:</strong> ${correctAnswers} / ${totalQuestions || 1}</p>
          <p><strong>Foiz:</strong> ${totalQuestions ? Math.round((correctAnswers / totalQuestions) * 100) : 0}%</p>
        </div>
        <button id="downloadBtn" class="download-btn">Natijani yuklab olish</button>
        <button id="restartBtn" class="restart-btn">Qayta boshlash</button>
      </div>
    `

    // Show result
    quizContainer.innerHTML = resultHTML
    timerContainer.style.display = "none"

    // Save to localStorage
    localStorage.setItem(
      "lastQuizResult",
      `
    <p><strong>Ism:</strong> ${userName}</p>
    <p><strong>Kurs:</strong> ${selectedCourse === "frontend" ? "Frontend dasturlash" : "Kompyuter savodxonligi"}</p>
    <p><strong>To'g'ri javoblar:</strong> ${correctAnswers} / ${totalQuestions || 1}</p>
    <p><strong>Foiz:</strong> ${totalQuestions ? Math.round((correctAnswers / totalQuestions) * 100) : 0}%</p>
  `,
    )

    // Add event listener to download button
    document.getElementById("downloadBtn").addEventListener("click", downloadResult)

    // Add event listener to restart button
    document.getElementById("restartBtn").addEventListener("click", () => {
      location.reload()
    })
  }

  // Download result as text file
  async function downloadResult() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();
  
    // Ma'lumotlar
    const totalQuestions = Object.keys(answers).length;
    const correctAnswers = Object.values(answers).filter((answer) => answer.isCorrect).length;
    const totalPossibleQuestions = 5;
    const userCourse = selectedCourse === "frontend" ? "Frontend dasturlash" : "Kompyuter savodxonligi";
  
    const resultText = `
  Ism: ${userName}
  Kurs: ${userCourse}
  Sana: ${new Date().toLocaleString()}
  -------------------------
  To'g'ri javoblar: ${correctAnswers} / ${totalQuestions || 1}
  Foiz: ${totalQuestions ? Math.round((correctAnswers / totalQuestions) * 100) : 0}%
  -------------------------
  ${timeLeft <= 0 ? "Vaqt tugadi!" : ""}
  `;
  
    // Sahifa o'lchamlari
    const pageWidth = doc.internal.pageSize.getWidth();
  
    // ==== Logotip markazda ====
    const logoBase64 = "data:image/png;base64," 
  
    const imageWidth = 40;
    const imageHeight = 40;
    const imageX = (pageWidth - imageWidth) / 2;
    doc.addImage(logoBase64, "PNG", imageX, 10, imageWidth, imageHeight);
  
    // ==== Sarlavha markazda ====
    doc.setFont("times", "bold");
    doc.setFontSize(18);
    const title = "Quiz App - Test natijalari";
    const titleWidth = doc.getTextWidth(title);
    const titleX = (pageWidth - titleWidth) / 2;
    doc.text(title, titleX, 60);
  
    // ==== Natija matni ====
    doc.setFont("times", "normal");
    doc.setFontSize(14);
    doc.text(resultText, 30, 80); 
  
    // ==== PDF saqlash ====
    doc.save(`${userName}_test_natija.pdf`);
  }
  
})

// Matnni belgilashni taqiqlash
document.addEventListener('selectstart', function(e) {
  e.preventDefault();
});

// O'ng tugmani taqiqlash
document.addEventListener('contextmenu', function(e) {
  e.preventDefault();
  alert("Kontekst menyuni ochish taqiqlangan!");
});

// Ctrl + C, Ctrl + U, Ctrl + S va boshqa kombinatsiyalarni taqiqlash
document.addEventListener('keydown', function(e) {
 
  if (e.ctrlKey && e.key.toLowerCase() === 'c') {
    e.preventDefault();
    alert("Nusxa olish taqiqlangan!");
  }
  else if (e.ctrlKey && e.key.toLowerCase() === 's') {
    e.preventDefault();
    alert("Sahifani saqlash taqiqlangan!");
  }
  else if (e.key === 'PrintScreen') {
      e.preventDefault();
      navigator.clipboard.writeText('');
      alert('Skrinshot olish taqiqlangan!');
    }
});

document.addEventListener('keydown', function (e) {
  // F12
  if (e.key === "F12" || e.keyCode === 123) {
    e.preventDefault();
    alert("Bu amal bloklangan!");
  }

  // Ctrl+Shift+I yoki Cmd+Option+I
  if ((e.ctrlKey && e.shiftKey && e.key.toLowerCase() === 'i') ||
      (e.metaKey && e.altKey && e.key.toLowerCase() === 'i')) {
    e.preventDefault();
    alert("Developer tools'ni ochish taqiqlangan!");
  }

  // Ctrl+Shift+C yoki Cmd+Option+C
  if ((e.ctrlKey && e.shiftKey && e.key.toLowerCase() === 'c') ||
      (e.metaKey && e.altKey && e.key.toLowerCase() === 'c')) {
    e.preventDefault();
    alert("Element inspektori bloklandi!");
  }

  // Ctrl+Shift+J yoki Cmd+Option+J
  if ((e.ctrlKey && e.shiftKey && e.key.toLowerCase() === 'j') ||
      (e.metaKey && e.altKey && e.key.toLowerCase() === 'j')) {
    e.preventDefault();
    alert("Konsolga kirish bloklandi!");
  }

  // Ctrl+U yoki Cmd+U
  if ((e.ctrlKey && e.key.toLowerCase() === 'u') ||
      (e.metaKey && e.key.toLowerCase() === 'u')) {
    e.preventDefault();
    alert("Kod ko‘rish bloklandi!");
  }
});
